435\u0440\u043f \u0438 \u041c\u043e\u043b\u043e\u0442 (\u0437\u0430\u0432\u043e\u0434 \u0432 \u041c\u043e\u0441\u043a\u0432\u0435)\">\u0437\u0430\u0432\u043e\u0434 \u00ab\u0421\u0435\u0440\u043f \u0438 \u043c\u043e\u043b\u043e\u0442\u00bb<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1884_%D0%B3%D0%BE%D0%B4\" title=\"1884 \u0433\u043e\u0434\">1884<\/a><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B6%D0%BE%D1%80%D0%B4%D0%B6_%D0%98%D1%81%D1%82%D0%BC%D0%B0%D0%BD\" class=\"mw-redirect\" title=\"\u0414\u0436\u043e\u0440\u0434\u0436 \u0418\u0441\u0442\u043c\u0430\u043d\">\u0414\u0436\u043e\u0440\u0434\u0436 \u0418\u0441\u0442\u043c\u0430\u043d<\/a> \u0437\u0430\u043f\u0430\u0442\u0435\u043d\u0442\u043e\u0432\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%BE%D1%82%D0%BE%D0%BF%D0%BB%D1%91%D0%BD%D0%BA%D0%B0\" title=\"\u0424\u043e\u0442\u043e\u043f\u043b\u0451\u043d\u043a\u0430\">\u0444\u043e\u0442\u043e\u043f\u043b\u0451\u043d\u043a\u0443<\/a>.<\/li><li>\u0411\u044b\u043b\u0430 \u043e\u0441\u0432\u044f\u0449\u0435\u043d\u0430 \u043f\u0435\u0440\u0432\u0430\u044f \u0446\u0435\u0440\u043a\u043e\u0432\u044c \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B0%D0%BC%D0%BE%D1%80%D0%B4%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D0%BE%D0%BD%D0%B0%D1%81%D1%82%D1%8B%D1%80%D1%8C\" title=\"\u0428\u0430\u043c\u043e\u0440\u0434\u0438\u043d\u0441\u043a\u0438\u0439 \u043c\u043e\u043d\u0430\u0441\u0442\u044b\u0440\u044c\">\u0428\u0430\u043c\u043e\u0440\u0434\u0438\u043d\u0441\u043a\u043e\u0439 \u043e\u0431\u0438\u0442\u0435\u043b\u0438<\/a>, \u0443\u0441\u0442\u0440\u043e\u0435\u043d\u043d\u0430\u044f \u0442\u0440\u0443\u0434\u0430\u043c\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BC%D0%B2%D1%80%D0%BE%D1%81%D0%B8%D0%B9_%D0%9E%D0%BF%D1%82%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B9\" title=\"\u0410\u043c\u0432\u0440\u043e\u0441\u0438\u0439 \u041e\u043f\u0442\u0438\u043d\u0441\u043a\u0438\u0439\">\u041e\u043f\u0442\u0438\u043d