u0435\u043d\u0442\">\u041a\u043b\u0435\u043c\u0435\u043d\u0442\u0430 \u0410\u0434\u0435\u0440\u0430<\/a> \u0441 \u0434\u0432\u0443\u043c\u044f \u043f\u0430\u0440\u043e\u0432\u044b\u043c\u0438 \u043c\u0430\u0448\u0438\u043d\u0430\u043c\u0438, \u043a\u0430\u0436\u0434\u0430\u044f \u0441 \u043e\u0434\u043d\u0438\u043c \u0442\u044f\u043d\u0443\u0449\u0438\u043c \u0432\u0438\u043d\u0442\u043e\u043c, \u043f\u0440\u043e\u043b\u0435\u0442\u0435\u043b \u043e\u043a\u043e\u043b\u043e 300 \u043c\u0435\u0442\u0440\u043e\u0432.<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1901_%D0%B3%D0%BE%D0%B4\" title=\"1901 \u0433\u043e\u0434\">1901<\/a>&#160;\u2014 \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u0430 \u043e\u0434\u043d\u0430 \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D1%83%D0%BF%D0%BD%D0%B5%D0%B9%D1%88%D0%B8%D0%B5_%D0%BC%D0%BE%D1%80%D1%81%D0%BA%D0%B8%D0%B5_%D0%BA%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D1%8B_XX_%D0%B2%D0%B5%D0%BA%D0%B0\" title=\"\u041a\u0440\u0443\u043f\u043d\u0435\u0439\u0448\u0438\u0435 \u043c\u043e\u0440\u0441\u043a\u0438\u0435 \u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u044b XX \u0432\u0435\u043a\u0430\">\u043a\u0440\u0443\u043f\u043d\u0435\u0439\u0448\u0438\u0445 \u043c\u043e\u0440\u0441\u043a\u0438\u0445 \u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444 XX \u0432\u0435\u043a\u0430<\/a>: \u0432 \u043d\u0435\u043f\u043e\u0433\u043e\u0434\u0443 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%B9%D0%BA%D0%B0%D0%BB\" title=\"\u0411\u0430\u0439\u043a\u0430\u043b\">\u0411\u0430\u0439\u043a\u0430\u043b\u0435<\/a> \u0437\u0430\u0442\u043e\u043d\u0443\u043b\u043e \u0441\u0443\u0434\u043d\u043e \u00ab<a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%9F%D0%BE%D1%82%D0%B0%D0%BF%D0%BE%D0%B2_(%D1%81%D1%83%D0%B4%D0%BD%D0%BE)&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u041f\u043e\u0442\u0430\u043f\u043e\u0432 (\u0441\u0443\u0434\u043d\u043e) (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u041f\u043e\u0442\u0430\u043f\u043e\u0432<\/a>\u00bb; \u043f\u043e\u0433\u0438\u0431\u043b\u043e \u043e\u043a\u043e\u043b\u043e 200 \u0447\u0435\u043b\u043e\u0432\u0435\u043a (\u0436\u0435\u0440\u0442\u0432\u0430\u043c\u0438 \u0441\u0442\u0430\u043b\u0438 \u0432 \u043e\u0441\u043d\u043e\u0432\u043d\u043e\u043c \u0433\u043e\u0440\u043e\u0436\u0430\u043d\u0435 \u0438 \u043a\u0440\u0435\u0441\u0442\u044c\u044f\u043d\u0435 \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%BE%D0%BC%D1%83%D1%82%D0%BE%D0%B2%D0%BE_(%D0%98%D1%80%D0%BA%D1%83%D1%82%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C)\" title=\"\u0425\u043e\u043c\u0443\u0442\u043e\u0432\u043e (\u0418\u0440\u043a\u0443\u0442\u0441\u043a\u0430\u044f \u043e\u0431\u043b\u0430\u0441\u0442\u044c)\">\u0425\u043e\u043c\u0443\u0442\u043e\u0432\u043e<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%91%D0%BA_(%D1%81%D0%B5%D0%BB%D0%BE)\" title=\"\u041e\u0451\u043a (\u0441\u0435\u043b\u043e)\">\u041e\u0435\u043a\u0430<\/a>) .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1905_%D0%B3%D0%BE%D0%B4\" title=\"1905 \u0433\u043e\u0434\">1905<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%B8%D0%B6\" title=\"\u041f\u0430\u0440\u0438\u0436\">\u041f\u0430\u0440\u0438\u0436\u0435<\/a> \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D0%B6%D0%B4%D1%83%D0%BD%D0%B0%D1%80%D0%BE%D0%B4%D0%BD%D0%B0%D1%8F_%D0%B0%D0%B2%D0%B8%D0%B0%D1%86%D0%B8%D0%BE%D0%BD%D0%BD%D0%B0%D1%8F_%D1%84%D0%B5%D0%B4%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D1%8F\" title=\"\u041c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u0434\u043d\u0430\u044f \u0430\u0432\u0438\u0430\u0446\u0438\u043e\u043d\u043d\u0430\u044f \u0444\u0435\u0434\u0435\u0440\u0430\u0446\u0438\u044f\">\u041c\u0435\u043